import styled from "styled-components";

export const Container = styled.div`
  position: absolute;
  background: white;
  top: 8em;
  width: 50%;
  height: 40%;
  box-shadow: 0 5px 16px rgba(0, 0, 0, 0.2);
  z-index: 1;

  .warning {
    color: red;
    display: flex;
    justify-content: center;
    margin-top: 2em;
  }
`;
